const CoursePart = ({part}) => (
  <>
    <td>{part.name}</td>
    <td>{part.exercises}</td>
  </>
)

const CourseContent = ({courseParts}) => (
  <table>
    <tbody>
      {courseParts.map(part => 
        <tr key={part.id}>
          <CoursePart part={part} />
        </tr>
      )}
    </tbody>
  </table>
)

const Course = ({course}) => {
  const sum = course.parts.reduce(
    (accumulator, currentValue) => accumulator + currentValue.exercises, 0
  )
  return (
    <>
      <h1>{course.name}</h1>
      <CourseContent courseParts={course.parts} />
    </>
  )
}

const App = () => {
  const course = {
    id: 1,
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }

  return <Course course={course} />
}

export default App
